	<script language="JavaScript">
		var implicitUri = "https://api.incontact.com/InContactAuthorizationServer/Authenticate";
		var client_id = "DeveloperPortalAccess@OATAPI";
		var token_scope = "AdminApi AgentApi";
		var redirect_uri = "https://olivat.no-ip.com/nic/index.htm";
		var state_object = "myState";
	
		function RedirectToAuthPage() {
			var url = implicitUri;
			url = url + "?state=" + state_object;
			url = url + "&response_type=token";
			url = url + "&client_id=" + encodeURIComponent(client_id);
			url = url + "&redirect_uri=" + encodeURIComponent(redirect_uri);
			//alert(url);
			url = url + "&scope=" + encodeURIComponent(token_scope);
			window.location.href = url;
		}
	
		function getParameterByName(param){
			var vars = {};
			window.location.href.replace( location.hash, '' ).replace( 
				/[?&]+([^=&]+)=?([^&]*)?/gi, // regexp
				function( m, key, value ) { // callback
					vars[key] = value !== undefined ? value : '';
				}
			);
			if ( param ) {
				return vars[param] ? vars[param] : null;	
			}
			return vars;
		}
	
		function getAgents() {
			var accessToken=decodeURIComponent(getParameterByName("access_token"));
			var baseURI=decodeURIComponent(getParameterByName("resource_server_base_uri"));
			getAgentsPayload = {
				'updatedSince': '',
				'isActive': 'true',
				'searchString': '',
				'fields': '',
				'skip': '',
				'top': '',
				'orderBy': 'firstName'
			}
			$.ajax({
				//The baseURI variable is created by the result.resource_server_base_uri,
				//which is returned when getting a token and should be used to create the URL base
				'url': baseURI + 'services/v12.1/agents',
				'type': 'GET',
				'headers': {
					//Use access_token previously retrieved from inContact token service
					'Authorization': 'bearer ' + accessToken,
					'content-Type': 'application/x-www-form-urlencoded'
				},
				'data': getAgentsPayload,
				'success': function (result, status, statusCode) {
					//Process success actions
					//alert("test="+result.agents[3].lastName);
					//alert("test="+result.agents.length);
					var select = document.getElementById ("nom");
					for (i=0;i<result.agents.length;i++) {
						select.options[select.options.length] = new Option (result.agents[i].firstName +" "+ result.agents[i].lastName, result.agents[i].agentId);
				   }
					return result;
				},
				'error': function (XMLHttpRequest, textStatus, errorThrown) {
					//Process error actions
					alert("GetAgents - "+textStatus+" - "+errorThrown);
					return false;
				}
			});
		}

		function getSkills() {
			var accessToken=decodeURIComponent(getParameterByName("access_token"));
			var baseURI=decodeURIComponent(getParameterByName("resource_server_base_uri"));
			var getSkillsPayload = {
				'updatedSince': '',
				'mediaTypeId': 4,
				'outboundStrategy': 'Manual',
				'isActive': 'true',
				'searchString': 'OAT',
				'fields': '',
				'skip': '',
				'top': '',
				'orderBy': 'skillName'
			}
			$.ajax({
				//The baseURI variable is created by the result.resource_server_base_uri,
				//which is returned when getting a token and should be used to create the URL base
				'url': baseURI + 'services/v12.0/skills',
				'type': 'GET',
				'headers': {
					//Use access_token previously retrieved from inContact token service
					'Authorization': 'bearer ' + accessToken,
					'content-Type': 'application/x-www-form-urlencoded'
				},
				'data': getSkillsPayload,
				'success': function (result, status, statusCode) {
					//Process success actions
					//alert("2");
					var select = document.getElementById ("skills");
					for (i=0;i<result.skills.length;i++) {
						select.options[select.options.length] = new Option (result.skills[i].skillName, result.skills[i].skillId);
				   }
					return result;
				},
				'error': function (XMLHttpRequest, textStatus, errorThrown) {
					alert("GetSkills - "+textStatus+" - "+errorThrown);
					//Process error actions
					return false;
				}
			});
		}
	
		function getSkillScheduledCallbacks(skillId) {
			var accessToken=decodeURIComponent(getParameterByName("access_token"));
			var baseURI=decodeURIComponent(getParameterByName("resource_server_base_uri"));
			$.ajax({
				//The baseURI variable is created by the result.resource_server_base_uri,
				//which is returned when getting a token and should be used to create the URL base
				'url': baseURI + 'services/v12.0/skills/' + skillId + '/scheduled-callbacks',
				'type': 'GET',
				'headers': {
					//Use access_token previously retrieved from inContact token service
					'Authorization': 'bearer ' + accessToken,

				'success': function (result, status, statusCode) {

				'error': function (XMLHttpRequest, textStatus, errorThrown) {
					//Process error actions
					alert("getSkillScheduledCallbacks - "+textStatus+" - "+errorThrown);
					return false;
				}
			});


			function deleteScheduledCallback(callbackId) {
				var accessToken=decodeURIComponent(getParameterByName("access_token"));
				var baseURI=decodeURIComponent(getParameterByName("resource_server_base_uri"));
				$.ajax({
					//The baseURI variable is created by the result.resource_server_base_uri,
					//which is returned when getting a token and should be used to create the URL base
					'url': baseURI + 'services/v12.0/scheduled-callbacks/' + callbackId,
					'type': 'DELETE',
					'headers': {
						//Use access_token previously retrieved from inContact token service
						'Authorization': 'bearer ' + accessToken,
						'content-Type': 'application/x-www-form-urlencoded'
					},
					'success': function (result, status, statusCode) {
						//Process success actions
						alert("Schedule has been cancelled!");
						return result;
					},
					'error': function (XMLHttpRequest, textStatus, errorThrown) {
						//Process error actions
						alert("deleteScheduledCallback - "+textStatus+" - "+errorThrown);
						return false;
					}
				});
}
	}


	</script>

		function createCookie(name,value,days) {
			if (days) {
				var date = new Date();
				date.setTime(date.getTime()+(days*24*60*60*1000));
				var expires = "; expires="+date.toGMTString();
			}
			else var expires = "";
			document.cookie = name+"="+value+expires+"; path=/";
		}

		function readCookie(name) {
			var nameEQ = name + "=";
			var ca = document.cookie.split(';');
			for(var i=0;i < ca.length;i++) {
				var c = ca[i];
				while (c.charAt(0)==' ') c = c.substring(1,c.length);
				if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length,c.length);
			}
			return null;
		}

		function getCookie(sName) {
				var cookContent = document.cookie, cookEnd, i, j;
				var sName = sName + "=";
		
				for (i=0, c=cookContent.length; i<c; i++) {
						j = i + sName.length;
						if (cookContent.substring(i, j) == sName) {
								cookEnd = cookContent.indexOf(";", j);
								if (cookEnd == -1) {
										cookEnd = cookContent.length;
								}
								return decodeURIComponent(cookContent.substring(j, cookEnd));
						}
				}       
				return null;
		}
